  input: TEXT,F3XA,,"This amended report is the result of the committee's management's
    failure to forward all necessary accounting records to the accountant who prepared
    the original report.  Management failed to provide information on a bank account
    for federal funds which was opened on 1-7-04.  This amended report list two contributions
    received and deposited which were omitted on the original report.  In addition
    it lists four disbursments omitted from the original report.  Interest income
    earned by the account has also been included as receipts on this amended report.    Your
    review letter dated September 8, 2004, questions why $22,545 of receipts and disbursments
    were omitted fro the original report.  In January 2004, the committee opened an
    account to handle funds for an activity called Oklahoma Victory 2004.  The individual
    who was managing this account erroneously received advice from legal council that
    this activity, including all receipts and disbursements going into and out of
    the the Oklahoma Victory 2004 account would be reported separately and not included
    with the committee's report.  Based on this advice, the manager of this account
    did not forward the informantion to the indinidual who prepares the committee's
    reoprts.  As a result the receipts and disbursements of the Oklahoma Victory 2004
    account were omitted.  "
